using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.Data;
using System.Drawing;
using System.IO;
using System.Linq;
using System.Text;
using System.Windows.Forms;

namespace WinSystemFunction
{
    public partial class ImgToString : Form
    {
        public ImgToString()
        {
            InitializeComponent();
        }

        private void ImgToString_Load(object sender, EventArgs e)
        {

            byte[] buf = Convert.FromBase64String("");

            MemoryStream stream = new MemoryStream(buf);
            Image img = Image.FromStream(stream);
            stream.Position = 0;

            img.Save("D:\\桌面\\Image\\1.jpg");
            stream.Close();


        }
    }
}
